import styled from "styled-components";

const Container = styled.div`
  width: 95%;
  height: 500px;
  max-width: 1200px;
  margin: 0 auto;
  margin-top: 70px;
  border: 1px solid red;
  padding: 50px 20px;
`;

const Title = styled.div`
  width: 100%;
  height: 30px;
  font-size: 1.5rem;
  line-height: 1.5rem;
  font-weight: 800;
`;

const Products = () => {
  return (
    <Container>
      <Title title="12345345" />
      <div>123</div>
    </Container>
  );
};

export default Products;
